import * as React from 'react'
import SplitPane from 'react-split-pane';
import Main from './components/Main';
import RightPanel from './components/RightPanel'
import {
  BrowserRouter as Router,
} from "react-router-dom";

import './style.css';

const styles = {
  background: '#000',
  width: '2px',
  cursor: 'col-resize',
  margin: '0 5px',
  height: '100%',
};

function App() {

  return (
    <Router>
      <div>
        <SplitPane
          split="vertical"
          minSize={500}
          defaultSize={1200}
          resizerStyle={styles}>
          <div><Main /></div>
          <div><RightPanel /></div>
        </SplitPane>
      </div>
    </Router>
  );
}

export default App;
